import React from 'react';

import styled from 'styled-components';
import { Container } from './styled/Container.styled';

const Card = (props) => {
    console.log(props);
    return (
        <Container>
            <Content>
                <h2>{props.title}</h2>
                <p>{props.body}</p>
            </Content>
        </Container>
    );
};

const Content = styled.div`
    padding: 4em 8em;
    margin: 1em 0;
    border-radius: 2em;
    box-shadow: 0 0 10px rgba(0, 0, 0, 0.15);
`;

export default Card;
